angular.module("EmployeeManager").service("EmployeeService",["$http",function(n){const t={headers:{"Content-Type":"application/json; charset=utf-8"}};var i=function(){return n.get("/Employee",t)},r=function(i){return n.get("/Employee/"+i,t)},u=function(i){return n.post("/Employee",JSON.stringify(i),t)},f=function(i){return n.put("/Employee/"+i.id,JSON.stringify(i),t)},e=function(i){return n.delete("/Employee/"+i,t)};return{list:i,get:r,post:u,put:f,"delete":e}}]);